import React from "react";
import {Link} from "react-router-dom";
import SecondNavBar from "./SecondNavBar";
import OrderImg from "../../assets/order.svg";
import PendingImg from "../../assets/pending.svg";
import DeliveryImg from "../../assets/delivery.svg";

const UserDashboardNavBar = () => {
    return(
        <div>
            <SecondNavBar />
            <nav>
                <ul className="uldash ">
                    <Link className="dashnav dashnav1" to="/userdashboardhome"><li className="color-color"> <img className="dashicon dashicon1" src={OrderImg} alt="dash"/> Order</li></Link>
                    <Link className="dashnav dashnav2" to="/userdashboardpending"><li className="color-color"> <img className="dashicon dashicon2" src={PendingImg} alt="dash"/> Pending</li></Link>
                    <Link className="dashnav dashnav3" to="/userdashboarddeliveries"><li className="color-color"> <img className="dashicon dashicon3" src={DeliveryImg} alt="dash"/> Deliveries</li></Link>
                </ul>
            </nav>
        </div>
    ) 
}

export default UserDashboardNavBar;
